Vanessa and I filmed this discussion a few months ago, and yet, this conversation is more relevant than ever. As the House is currently talking about regulating the tech industry, online sexual exploitation has continued to be a prevalent part of the discussion.

@VanessaMarano and I spoke with the incredible Hera from @ChaynHQ and the wonderful Romina from @equalitynoworg about what tech companies are actively doing to combat online sexual exploitation, the dangers of misinformation, how racism and exploitation are often intertwined, and our responsibilities as citizens of the digital age.

We broke this conversation up into three parts, and we'll be posting the other two videos in the next few days. Thank you Romina and Hera for your time and knowledge!! Having conversations like these is the first step to tackling online sexual exploitation, but as you'll see/hear from this discussion, we also need laws and regulations in place to protect us from being susceptible to this issue.
